import React from "react";
import { TouchableOpacity } from "react-native-gesture-handler";
import { H2 } from "./AppText";

function PickerItem({ label, onPress }) {
  return (
    <TouchableOpacity onPress={onPress}>
      <H2>{label}</H2>
    </TouchableOpacity>
  );
}

export default PickerItem;
